sButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":1.1198208286674,\"y\":77.455752212389,\"width\":46.808510638298,\"height\":15.044247787611,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The crude sap circulates inside the conducting vessels, from the roots to the stem and finally to the leaves.</p>\\n\"},\"subContentId\":\"59647fd4-8e85-4d71-b5c0-d6e10429fddf\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":41.758241758242,\"y\":21.691973969631,\"width\":13.046526577438,\"height\":8.3899373584906,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Crude sap</strong></p>\\n\"},\"subContentId\":\"434671c3-c520-4fff-9c5d-e00c04525f62\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.0989010989011,\"y\":2.1691973969631,\"width\":39.977603583427,\"height\":8.4070796460177,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h2>Photosynthesis</h2>\\n\"},\"subContentId\":\"1e83f700-ff16-44f8-9791-2927a8a9b4dc\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":1.9120458891013,\"y\":15.094339622642,\"width\":44.568868980963,\"height\":54.867256637168,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Chlorophyllic plants make their own organic matter from inorganic substances in the presence of light. Photosynthesis is characterized by an absorption of carbon dioxide and a release of oxygen.</p>\\n\\n<ul>\\n\\t<li>Carbon dioxide from the air passes through small pores (holes) in the leaves. These pores are called stomata.</li>\\n\\t<li>Sunlight is absorbed by a green pigment in the leaves called chlorophyll.</li>\\n</ul>\\n\\n<p></p>\\n\"},\"subContentId\":\"3ebd2e64-d9cf-4896-a6b6-43e7190ee85d\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":1.9120458891013,\"y\":71.698113207547,\"width\":37.849944008959,\"height\":6.1946902654867,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Organic matter + Water = <strong>Elaborated sap</strong></p>\\n\"},\"subContentId\":\"2d23a0dd-836c-42f0-bbc2-de214bab41c9\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":1.9120879120879,\"y\":86.290672451193,\"width\":95.410256483516,\"height\":12.848879392625,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The elaborated sap is translocated through conducting vessels from the leaves towards the roots. Excess organic matter is accumulated in the storage organs such as fruits and tubers.</p>\\n\"},\"subContentId\":\"38d18eae-7f26-437b-92e6-e32094f350b7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[]
